void get_count(int i = 0, int k = 0) { // i - –Ω–æ–º–µ—Ä —Å—Ç—Ä–æ–∫–∏
    for (int j = k; j < field_size; ++j) { // j - –Ω–æ–º–µ—Ä —Å—Ç–æ–ª–±—Ü–∞
        if (col[j] < 2 && row[i] < 2 && main_diag[i + j] < 2 && side_diag[field_size - i + j] < 2) {
            if (cnt == max_count - 1) {
                result++;
                // —Å—Ç—Ä–æ–∫–∏ 29-31 —Ç–æ–ª—å–∫–æ –¥–ª—è –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–∏, –µ—Å–ª–∏ –Ω–µ –Ω–∞–¥–æ - –∑–∞–∫–æ–º–º–µ–Ω—Ç–∏—Ä–æ–≤–∞—Ç—å
                arr[i][j]++;
                print(arr);
                arr[i][j]--;
                return;
            }
            else {
                row[i]++;
                col[j]++;
                main_diag[i + j]++;
                side_diag[field_size - i + j]++;
                arr[i][j]++; // —Ç–æ–ª—å–∫–æ –¥–ª—è –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–∏
                cnt++;

