void solve() {
    int n;
    ull k;
    cin >> n >> k;

    if (k & 1) {
        cout << "No" << en;
        return;
    }

    vector<int> v(n);
    for (int i = 0; i < n; i++)
        v[i] = n - i;

    ull sum = 0;
    for (int i = 0; i < n; i++)
        sum += abs(v[i] - (i + 1));

    if (sum < k) {
        cout << "No" << en;
        return;
    }

    vector<int> answer(n);
    for (int i = 0; i < n; i++)
        answer[i] = i + 1;

    if (k == 0) {
        cout << "Yes" << en;
        foutsp(answer);
        return;
    }

    ull k_ = 0;
    for (int i = 0; i < n; i++) {
        int j1 = i, j2 = n - i - 1;
        int x = 2 * (j2 - j1);

        if (k_ + x < k) {
            k_ += x;
            swap(answer[j1], answer[j2]);
        }
        else if (k_ + x == k) {
            swap(answer[j1], answer[j2]);

            cout << "Yes" << en;
            foutsp(answer);

            return;
        }
        else {
            int x = k - k_;
            int j1 = i, j2 = i + x / 2;

            swap(answer[j1], answer[j2]);

            cout << "Yes" << en;
            foutsp(answer);

            return;
        }
    }
}

