#include <TFT_eSPI.h>  // https://github.com/Bodmer/TFT_eSPI  

TFT_eSPI tft = TFT_eSPI();  // User_Setup_Select.h - ESP32-2432S028R  - Arduino IDE: DOIT ESP32 DEVKIT V1
TFT_eSprite origSprite = TFT_eSprite(&tft);
TFT_eSprite destSprite = TFT_eSprite(&tft);

uint16_t i;  // teller om de graden bij te houden

void setup() {
  tft.init();
  tft.setRotation(3);
  tft.fillScreen(TFT_BLACK);
  origSprite.createSprite(60, 60);
  destSprite.createSprite(60, 60);
  destSprite.fillEllipse(30, 14, 7, 8, TFT_YELLOW);                                        // teken 1 bloemblaadje
  destSprite.fillCircle(30, 30, 9, TFT_RED);                                               // centrum van de bloem
  for (uint8_t j = 0; j < 6; j++) destSprite.pushRotated(&origSprite, j * 60, TFT_BLACK);  // zet 6 bloemblaadjes op de bloem
}

void loop() {    // ongeveer 90 frames per seconde bij 5 bloemen
  i += 1 % 360;  // 0..359
  int hoog = (tft.height() - destSprite.height()) / 2;
  int breed = (tft.width() - destSprite.width()) / 2;
  destSprite.fillSprite(TFT_BLACK);
  origSprite.pushRotated(&destSprite, -i, TFT_BLACK);  // draai bloem over eigen middelpunt tegen wijzerzin
  for (uint8_t j = 0; j < 7; j++) {                    // beweeg 7 bloemen clockwise in ellips over display
    destSprite.pushSprite(breed + breed * cos((i + j * 51) * M_PI / 180), hoog + hoog * sin((i + j * 51) * M_PI / 180));
  }
}

